// Filter applies the HushWhereInput filter on the HushQuery builder.
func (i *HushWhereInput) Filter(q *HushQuery) (*HushQuery, error) {
	if i == nil {
		return q, nil
	}
	p, err := i.P()
	if err != nil {
		if err == ErrEmptyHushWhereInput {
			return q, nil
		}
		return nil, err
	}
	return q.Where(p), nil
}

