// Filter applies the ProgramWhereInput filter on the ProgramQuery builder.
func (i *ProgramWhereInput) Filter(q *ProgramQuery) (*ProgramQuery, error) {
	if i == nil {
		return q, nil
	}
	p, err := i.P()
	if err != nil {
		if err == ErrEmptyProgramWhereInput {
			return q, nil
		}
		return nil, err
	}
	return q.Where(p), nil
}

